svg.script:
var last_position = {},
mousemove_ok = true,
mouse_timer = setInterval(function () {
	mousemove_ok = true;
}, 500),
count = 1;

function startMove(evt, moveType){
     x1 = evt.clientX;
     y1 = evt.clientY;
     document.documentElement.setAttribute("onmousemove","moveIt(evt); evt.preventDefault(); ")
     document.documentElement.setAttribute("ontouchmove","moveIt(evt); evt.preventDefault(); ")

     C = document.getElementById('mouse');
     //C.setAttributeNS(null, "onmouseout", "endMove()");
     C.setAttributeNS(null, "onmouseup", "endMove(); evt.preventDefault(); ");
     C.setAttributeNS(null, "ontouchend", "endMove(); evt.preventDefault(); ");
}

function moveIt(evt){
    translation = C.getAttributeNS(null, "transform").slice(10,-1).split(',');
    sx = parseInt(translation[0]);
    sy = parseInt(translation[1]);

    C.setAttributeNS(null, "transform", "translate(" + (sx + evt.clientX - x1) + "," + (sy + evt.clientY - y1) + ")");
    x1 = evt.clientX;
    y1 = evt.clientY;

    if (mousemove_ok) {
        mousemove_ok = false;
        if (typeof(last_position.x) != 'undefined') {
            var deltaX = last_position.x - event.clientX,
                deltaY = last_position.y - event.clientY;
            if (Math.abs(deltaX) > Math.abs(deltaY)  deltaX > 0) {
                //left
                $output.append('
Left (' + (count++) + ')
');
            } else if (Math.abs(deltaX) > Math.abs(deltaY)  deltaX  0) {
                //right
                $output.append('
Right (' + (count++) + ')
');
            } else if (Math.abs(deltaY) > Math.abs(deltaX)  deltaY > 0) {
                //up
                $output.append('
Up (' + (count++) + ')
');
            } else if (Math.abs(deltaY) > Math.abs(deltaX)  deltaY  0) {
                //down
                $output.append('
Down (' + (count++) + ')
');
            }
            if ($output.children().length> 10) {
                $output.children().eq(0).remove();
            }
        }
        last_position = {
            x : event.clientX,
            y : event.clientY
        };
    }
}

function endMove(){
    document.documentElement.setAttributeNS(null, "onmousemove",null)
    document.documentElement.setAttributeNS(null, "ontouchmove",null)
}
var change = {
  37: {
    left: "-=1"
  },

  38: {
    top: "-=1"
  },

  39: {
    left: "+=1"
  },

  40: {
    top: "+=1"
  },
}

var going;

function keyDown(e) {
  window.addEventListener("keyup", keyup, false);
  var animation = change[e.which];
  going = setInterval(keepGoing, 1);
  C = document.getElementById('mouse');
  translation = C.getAttributeNS(null, "transform").slice(10,-1).split(',');
  x1 = e.layerX;
  y1 = e.layerY;
  sx = parseInt(translation[0]);
  sy = parseInt(translation[1]);
  transform = null;

  if(e.which == 37) { // left
	transform = "translate(" + (sx - 50 - x1) + "," + (sy - y1) + ")";
	e.preventDefault();
  }
  else if(e.which == 38) { // down
	transform = "translate(" + (sx - x1) + "," + (sy - 50 - y1) + ")";
	e.preventDefault();
  }
  else if(e.which == 39) { // right
	transform = "translate(" + (sx + 50 - x1) + "," + (sy - y1) + ")";
	e.preventDefault();
  }
  else if(e.which == 40) { // up
	transform = "translate(" + (sx - x1) + "," + (sy + 50 - y1) + ")";
	e.preventDefault();
  }
  x1 = e.layerX;
  y1 = e.layerY;

  function keepGoing() {
	C.setAttributeNS(null, "transform", transform);
  }
  return false;
}

function keyup(e) {
  clearInterval(going)
  window.addEventListener("keydown", keyDown, false);
}

window.addEventListener("keydown", keyDown, false);
